import React from 'react';
// import logo from './logo.svg';
import './App.css';
import AddToDoForm from './components/AddToDoForm'
import List from './components/List'

function App() {
  return (
    <div className="App">
      <h1>Welcome to the To-Do App!</h1>
      <AddToDoForm />
      <br />
      <span> (Click on the check-box to mark Tasks as Finished) </span>
      <div id='listsContainer'>
        <div>
          <h4>TO-DO</h4>
          <List type={"unfinished"}/>
        </div>
        <div>
          <h4>FINISHED</h4>
          <List type={"finished"}/>
        </div>

      </div>
    </div>
  );
}

export default App;
